import React from "react";
import 'bootstrap/dist/css/bootstrap.css'
import {Navbar} from 'react-bootstrap';

class NaviBarComponent {
    render(){
        return (
            <Navbar bg="dark" variant="dark">
            <Navbar.Brand>
                Logo
            </Navbar.Brand>
    </Navbar>        
    )
    }
}

export {NaviBarComponent}
